pragma solidity 0.6.11;
pragma experimental ABIEncoderV2;

import "@openzeppelin/contracts-ethereum-package/contracts/access/Ownable.sol";
import "./IdentityUserType.sol";
import "../../name/contracts/NameRegistry.sol";
import "../../name/contracts/Contracts.sol";

contract LicensedUserEvent is IdentityUserType, Contracts, OwnableUpgradeSafe {
  /*
   * Modifiers
   */
  modifier onlyLicensedUser() {
    require(_isLicensedUser(), "The sender is not the LUW");
    _;
  }

  modifier onlyFactory() {
    require(_isFactory(), "The sender is not the LicensedUserFactory");
    _;
  }

  /*
   * Events
   */

  /*
   * Events for Factory wallet contract
   */
  event ContractInstantiation(
    address indexed sender,
    address indexed instantiation
  );
  event CreateLicensedUserWallet(
    address indexed contractAddress,
    address[] owners,
    uint256 requiredConfirmation,
    string englishName,
    string originalName,
    UserType userType
  );

  /*
   * Events for licensed user proxy wallet contract
   */
  event MultiSigConfirmation(
    address indexed proxyContractAddr,
    address indexed sender,
    uint256 indexed transactionId
  );
  event MultiSigRevocation(
    address indexed proxyContractAddr,
    address indexed sender,
    uint256 indexed transactionId
  );
  event MultiSigSubmission(
    address indexed proxyContractAddr,
    uint256 indexed transactionId
  );
  event MultiSigExecution(
    address indexed proxyContractAddr,
    uint256 indexed transactionId
  );
  event MultiSigExecutionFailure(
    address indexed proxyContractAddr,
    uint256 indexed transactionId
  );
  event MultiSigOwnerAddition(
    address indexed proxyContractAddr,
    address indexed owner
  );
  event MultiSigOwnerRemoval(
    address indexed proxyContractAddr,
    address indexed owner
  );
  event MultiSigRequirementChange(
    address indexed proxyContractAddr,
    uint256 required
  );

  /*
   * NameRegistry
   */

  NameRegistry private _nameRegistry;

  /**
   * @dev Initializes this contract
   * @param registryAddress address of the NameRegistry
   */
  function initialize(address registryAddress) public initializer {
    _nameRegistry = NameRegistry(registryAddress);
    OwnableUpgradeSafe.__Ownable_init();
  }

  /**
   * @dev Sets the NameRegistry proxy address
   * @param registry proxy address
   */
  function setRegistry(address registry) public onlyOwner {
    _nameRegistry = NameRegistry(registry);
  }

  /**
   * @dev Gets the endpoint address of NameRegistry
   * @return NameRegistry proxy address
   */
  function getNameRegistry() public view returns (NameRegistry) {
    return _nameRegistry;
  }

  function _userFactoryAddress() private view returns (address) {
    return _nameRegistry.get(LICENSED_USER_WALLET_FACTORY);
  }

  function _isFactory() private view returns (bool) {
    return _userFactoryAddress() == msg.sender;
  }

  function _isLicensedUser() private view returns (bool) {
    return _nameRegistry.instantiation(msg.sender);
  }

  /*
   * Log functions to emit events
   */

  /*
   * Log functions for Factory wallet contract
   */
  function logContractInstantiation(address instantiation) public onlyFactory {
    emit ContractInstantiation(msg.sender, instantiation);
  }

  function logCreateLicensedUserWallet(
    address contractAddress,
    address[] memory owners,
    uint256 requiredConfirmation,
    string memory englishName,
    string memory originalName,
    UserType userType
  ) public onlyFactory {
    emit CreateLicensedUserWallet(
      contractAddress,
      owners,
      requiredConfirmation,
      englishName,
      originalName,
      userType
    );
  }

  /*
   * Log functions for Factory wallet contract
   */
  function logConfirmation(address sender, uint256 transactionId)
    public
    onlyLicensedUser
  {
    emit MultiSigConfirmation(msg.sender, sender, transactionId);
  }

  function logRevocation(address sender, uint256 transactionId)
    public
    onlyLicensedUser
  {
    emit MultiSigRevocation(msg.sender, sender, transactionId);
  }

  function logSubmission(uint256 transactionId) public onlyLicensedUser {
    emit MultiSigSubmission(msg.sender, transactionId);
  }

  function logExecution(uint256 transactionId) public onlyLicensedUser {
    emit MultiSigExecution(msg.sender, transactionId);
  }

  function logExecutionFailure(uint256 transactionId) public onlyLicensedUser {
    emit MultiSigExecutionFailure(msg.sender, transactionId);
  }

  function logOwnerAddition(address owner) public onlyLicensedUser {
    emit MultiSigOwnerAddition(msg.sender, owner);
  }

  function logOwnerRemoval(address owner) public onlyLicensedUser {
    emit MultiSigOwnerRemoval(msg.sender, owner);
  }

  function logRequirementChange(uint256 required) public onlyLicensedUser {
    emit MultiSigRequirementChange(msg.sender, required);
  }
}
